angular.module('evid').run(['$templateCache', function($templateCache) {
  'use strict';

  $templateCache.put('partials/api.html',
    "<md-toolbar class=\"md-toolbar-tools md-accent\"><h2>{{ api.path }}</h2><span ng-if=api.version class=evid-api-version>v{{ api.version }}</span> <span flex></span><md-button aria-label=\"Send request\" class=\"md-icon-button evid-api-export\" ng-click=showConsole()><md-icon md-menu-origin md-font-library=material-icons>send</md-icon></md-button><md-menu ng-if=\"api.links.length > 0\"><md-button aria-label=\"Export schema\" class=\"md-icon-button evid-api-export\" ng-click=$mdOpenMenu($event)><md-icon md-menu-origin md-font-library=material-icons>archive</md-icon></md-button><md-menu-content width=3><md-menu-item ng-repeat=\"link in api.links\"><md-button href=\"{{ link.href }}\" target=_blank>{{ link.rel|ucfirst }}</md-button></md-menu-item></md-menu-content></md-menu></md-toolbar><md-tabs md-dynamic-height md-selected=selectedMethod><md-tab ng-repeat=\"(methodName, method) in methods\" label=\"{{ methodName }}\"><md-content ng-bind-html=method flex></md-content></md-tab></md-tabs>"
  );


  $templateCache.put('partials/console.html',
    "<md-dialog aria-label=Console style=width:800px><md-toolbar class=md-toolbar-tools><h2>{{ request.method }}</h2></md-toolbar><md-dialog-content style=max-width:800px;max-height:600px><div layout layout-sm=column><md-input-container flex><label>URL</label><input ng-model=request.url></md-input-container><md-input-container flex=30><label>Access-Token (OAuth2)</label><input ng-model=request.accessToken></md-input-container></div><md-input-container ng-if=\"request.method == 'POST' || request.method == 'PUT'\"><label>Body</label><textarea ng-model=request.body class=evid-console-body></textarea></md-input-container><md-subheader class=md-hue-1 ng-if=response.statusCode>{{ response.statusCode }} {{ response.statusText }}</md-subheader><div layout=row layout-sm=column layout-align=space-around ng-if=loading><md-progress-circular md-mode=indeterminate></md-progress-circular></div><div ng-if=!loading><div hljs language=json source=response.body ng-if=response.body></div></div></md-dialog-content><div class=md-actions layout=row><md-button class=\"md-raised md-primary\" ng-click=sendRequest()>Send</md-button></div></md-dialog>"
  );


  $templateCache.put('partials/page.html',
    "<md-toolbar class=\"md-toolbar-tools md-accent\"><h2>{{ title }}</h2></md-toolbar><ng-include src=href></ng-include>"
  );

}]);
